pragma solidity ^0.4.18;

contract NoSecret {

//struct
    struct User {
        uint256 user_key;
        uint256 money_give;
        uint256 money_join;
        uint256[] circle_create;
        uint256[] circle_join;
    }

    struct Circle {
        uint256 circle_key;
        address owner_address;
        uint256 fee;
    }

    struct Message {
        uint256 message_key;
        uint256 circle_key;
        address owner_address;
        uint256 money;
    }

//para
    address owneraddress;
    uint256 userkey = 1;
    uint256 circlekey = 1;
    uint256 messagekey = 1;
    uint256 create_fee = 1;
    uint256 gas = 1;
    uint256 profit = 0;

//mapping
    mapping(address => User) users;
    mapping(uint256 => Circle) circles;
    mapping(uint256 => Message) messages;

//event
    event createuserSucess(address);
    event createcircleSucess(uint256);
    event createmessageSuccess(uint256);
    event paymessageSucess(uint256, uint256);
    event joincircleSucess(uint256[]);

//tron
    constructor () public {
        owneraddress = msg.sender;        
        //init();         
    }
/*
    function init () public {

    }
*/

//modifier
    modifier onlyOwner () {
        require(msg.sender == owneraddress);
        _;
    }

    modifier onlyEnough () {
        require(msg.value >= create_fee);
        _;
    }

    modifier onlyUser () {
        User memory user = users[msg.sender];
        require(user.user_key > 0);
        _;
    }

//user
    //user
    function getUser () public view returns(uint256, uint256, uint256, uint256[], uint256[]) {
        User memory user = users[msg.sender]; 
        return(user.user_key, user.money_give, user.money_join, user.circle_create,user.circle_join);
    }

    //check user
    function checkUser () public view returns(bool) {
        User memory user = users[msg.sender]; 
        if(user.user_key > 0) {
            return true;
        }
        return false;
    }

    //userkey
    function getUserKey () public view returns (uint256) {
        return userkey;
    }

    //update user.circle_join
    function updateUserCirclejoin (uint256 _circle_key) private {
        User storage user = users[msg.sender]; 
        uint256[] storage _circle_join = user.circle_join;
        _circle_join.push(_circle_key);
        users[msg.sender] = user;
    }

    //update user.circle_create
    function updateUserCirclecreate (uint256 _circle_key) private {
        User storage user = users[msg.sender]; 
        uint256[] storage _circle_create = user.circle_create;
        _circle_create.push(_circle_key);
        users[msg.sender] = user;
    }

    //update user.money_give
    function updateUserMoneygive (address owner, uint256 money) private {
        User memory user = users[owner]; 
        user.money_give = user.money_give + money;
        users[msg.sender] = user;
    }

    //update user.money_join
    function updateUserMoneyjoin (address owner, uint256 money) private {
        User memory user = users[owner]; 
        user.money_join = user.money_join + money;
        users[msg.sender] = user;
    }

    //check circle in circle_join or circle_create
    function checkHavecircl (uint256 _circle_key) public view returns(bool) {
        require(checkCircle(_circle_key));
        User memory user = users[msg.sender];
        uint256[] memory _circle_ceate = user.circle_create;
        uint256[] memory _circle_join = user.circle_join;
        for (uint256 i = 0; i < _circle_ceate.length; i++) {
            if (_circle_key == _circle_ceate[i]) {
                return true;
            }
        }
        for (i = 0; i < _circle_join.length; i++) {
            if (_circle_key == _circle_join[i]) {
                return true;
            }
        }
        return false;
    }

//circle
    //circle
    function getCircle (uint256 _circle_key) public view returns(uint256, address, uint256) {
        Circle memory circle = circles[_circle_key]; 
        return(circle.circle_key, circle.owner_address, circle.fee);
    }

    //check circle
    function checkCircle (uint256 _circle_key) public view returns(bool) {
        Circle memory circle = circles[_circle_key]; 
        if (circle.circle_key > 0) {
            return true;
        }
        return false;
    }

    //circlekey
    function getCircleKey () public view returns (uint256) {
        return circlekey;
    }

    //circle.fee
    function getCirclefee (uint256 _circle_key) private view returns (uint256) {
        Circle memory circle = circles[_circle_key];
        return circle.fee ;
    }

    //circle.owner_address
    function getCircleowner (uint256 _circle_key) private view returns (address) {
        Circle memory circle = circles[_circle_key];
        return circle.owner_address;
    }

    //circle.key
    function getCirclekey (uint256 _circle_key) private view returns (uint256) {
        Circle memory circle = circles[_circle_key];
        return circle.circle_key;
    }

//message
    //message
    function getMessage (uint256 _message_key) public view returns(uint256, uint256, address, uint256) {
        Message memory message = messages[_message_key]; 
        return(message.message_key, message.circle_key, message.owner_address, message.money);
    }

    //check message
    function checkMessage (uint256 _message_key) public view returns(bool) {
        Message memory message = messages[_message_key]; 
        if(message.message_key > 0){
            return true;
        }
        return false;
    }

    //messagekey
    function getMessageKey () public view returns (uint256) {
        return messagekey;
    }

    //message.message_key
    function getMessagekey (uint256 _message_key) private view returns (uint256) {
        Message memory message = messages[_message_key];
        return message.message_key;
    }

    //message.owner_address
    function getMessageowner (uint256 _message_key) private view returns (address) {
        Message memory message = messages[_message_key];
        return message.owner_address;
    }

    //更新 message.money
    function updateMessagemoney (uint256 _message_key, uint256 money) private {
        Message memory message = messages[_message_key];
        message.money = message.money + money;
        messages[_message_key] = message;
    }

//create_fee
    //get 
    function getCreatefee () public view returns (uint256) {
        return create_fee;
    }
    //update
    function updateCreatefee (uint256 _create_fee) public onlyOwner{
        create_fee = _create_fee;
    }

//gas
    //get
    function getGas () public view returns (uint256) {
        return gas;
    }

    //update
    function updateGas (uint256 _gas) public onlyOwner{
        gas = _gas;
    }

//profit相关
    //get
    function getProfit () public view returns (uint256) {
        return profit;
    }

    //update
    function updateProfit (uint256 _profit) private {
        profit = profit + _profit;
    }

//money
    //pay
    function pay2owner (address target_address, uint256 _value) private {
        target_address.transfer(_value);
    } 

//-----------------------------------------core-----------------------------------------
//create user
    function createUser (uint256[] _circle_join) public {
        uint256 _user_key = getUserKey();
        uint256[] memory _circle_create;
        User memory user = User({user_key:_user_key, money_give:0, money_join:0, circle_create:_circle_create, circle_join:_circle_join});
        users[msg.sender] = user;
        userkey ++;
        emit createuserSucess(msg.sender);
    }

//create circle
    function createCircle (uint256 _fee) public payable onlyEnough{
        require(checkUser());
        uint256 _circle_key = getCircleKey();
        address _owner_address = msg.sender;
        Circle memory circle = Circle({circle_key:_circle_key, owner_address:_owner_address, fee:_fee});
        circles[_circle_key] = circle;
        circlekey ++;
        pay2owner(owneraddress,msg.value);
        updateProfit(msg.value);
        updateUserCirclecreate(_circle_key);
        emit createcircleSucess(_circle_key);
    }

//create message
    function createMessage (uint256 _circle_key) public {
        require(checkUser());
        require(checkHavecircl(_circle_key));
        uint256 _message_key = getMessageKey();
        address _owner_address = msg.sender;
        Message memory message = Message({message_key:_message_key, circle_key:_circle_key, owner_address:_owner_address, money:0});
        messages[_message_key] = message;
        messagekey ++;
        emit createmessageSuccess(_message_key);
    }

//pay message
    function payMessage (uint256 _message_key, uint256 money) public payable {
        require(checkUser());
        require(msg.value >= money);
        Message memory message = messages[_message_key];
        require(checkMessage(_message_key)); 
        address message_owner = message.owner_address;
        uint256 gas_fee = msg.value * gas / 100;
        uint256 pay_fee = money - gas_fee;
        pay2owner(owneraddress, money - pay_fee);
        updateProfit(money - pay_fee);
        pay2owner(message_owner, pay_fee);
        updateMessagemoney (_message_key, money);
        updateUserMoneygive (message_owner, pay_fee);
        emit paymessageSucess(_message_key, money);
    }

//join circle
    function joinCircle (uint256[] _circle_keys) public payable {
        require(checkUser());
        uint256 all_fee = msg.value;
        uint256 _circle_key;
        uint256 circle_fee;
        address circle_owner;
        uint256 gas_fee;
        uint256 pay_fee;
        for(uint256 i = 0; i < _circle_keys.length; i++) {
            _circle_key = _circle_keys[i];
            require(checkCircle(_circle_key));
            circle_fee = getCirclefee(_circle_key);
            if(!checkHavecircl(_circle_key)){
                if(circle_fee > 0) {
                    require(all_fee >= circle_fee);
                    gas_fee = circle_fee * gas / 100;
                    pay_fee = circle_fee - gas_fee;
                    circle_owner = getCircleowner(_circle_key);
                    pay2owner(circle_owner,pay_fee);
                    pay2owner(owneraddress,gas_fee);
                    updateProfit(gas_fee);
                    updateUserMoneyjoin(circle_owner, circle_fee);
                    updateUserCirclejoin (_circle_key);
                    all_fee = all_fee - circle_fee;
                }
                else {
                    updateUserCirclejoin (_circle_key);
                }
            }
        }
        if (all_fee > 0) {
            pay2owner(owneraddress,all_fee);
        }
        emit joincircleSucess(_circle_keys);
    }
}
